package com.google.tendengce.entity;import java.util.Date;public class Score {    private int id;    private int amount;    private String vipFlag;    private Date createDate;    public int getId() {        return id;    }    public void setId(int id) {        this.id = id;    }    public int getAmount() {        return amount;    }    public void setAmount(int amount) {        this.amount = amount;    }    public String getVipFlag() {        return vipFlag;    }    public void setVipFlag(String vipFlag) {        this.vipFlag = vipFlag;    }    public Date getCreateDate() {        return createDate;    }    public void setCreateDate(Date createDate) {        this.createDate = createDate;    }}